import Card from "../UI/Card";

import classes from "./Budget.module.css";

const Budget = (props) => {
  return (
    <div>
      <Card className={classes.budget}>
        <span>Budget: ${props.budget}</span>
        <button onClick={props.handleEditClick}>Edit</button>
      </Card>
    </div>
  );
};

export default Budget;
